(55, 4, 'Nature Vit Dry Fruits Festival Gift Pack', 'https://res.cloudinary.com/devskjkco/image/upload/v1704450408/dry_fruits_image/elrmvq13jvvly2m4mgmt.jpg', 'If you need to buy wholesale, Please call office at 1800 1779 or email us at marudryfruits@gmail.com  to enquire', '<table cellpadding=\"0\" cellspacing=\"0\" class=\"xslData;XLSY;v2;4459;\" data-mce-fragment=\"1\" style=\"width: 1410px; border-spacing: 0px; color: rgb(33, 37, 41); font-family: Lato; font-size: 16px; text-align: justify; outline: 0px !important;\"><tbody data-mce-fragment=\"1\" style=\"outline: 0px !important;\"><tr data-mce-fragment=\"1\" style=\"outline: 0px !important;\"><td data-mce-fragment=\"1\" style=\"text-align: left; padding: 10px; outline: 0px !important;\"><p style=\"margin-right: 0px; margin-left: 0px; font-size: 14px; line-height: 28px; color: rgb(0, 0, 0); outline: 0px !important;\"><span data-mce-fragment=\"1\" style=\"outline: 0px !important;\">PERFECT GIFT FOR DIWALI: This festive season makes your Diwali special with the BOYO Diwali gift box and celebrates with joy and happiness. Perfect gift for friends, family, colleagues, and loved ones.</span></p><p style=\"margin-right: 0px; margin-left: 0px; font-size: 14px; line-height: 28px; color: rgb(0, 0, 0); outline: 0px !important;\"><span data-mce-fragment=\"1\" style=\"outline: 0px !important;\">THOUGHTFUL GIFTS: This Diwali make your loved ones feel special with BOYO mixed dry fruits gift box that has natural California almonds 120g, whole cashew 80g, Cranberry, Kulfi Raisin.</span></p><p style=\"margin-right: 0px; margin-left: 0px; font-size: 14px; line-height: 28px; color: rgb(0, 0, 0); outline: 0px !important;\"><span data-mce-fragment=\"1\" style=\"outline: 0px !important;\">PREMIUM NUTS: These nuts are handpicked, crunchy, and wholesome raw almonds sourced from the best farms in California.</span></p><p style=\"margin-right: 0px; margin-left: 0px; font-size: 14px; line-height: 28px; color: rgb(0, 0, 0); outline: 0px !important;\"><span data-mce-fragment=\"1\" style=\"outline: 0px !important;\">PREMIUM PACKAGING: These gift boxes come in premium packaging to retain their freshness.</span></p></td></tr></tbody></table>', '<table class=\"table table-striped table-bordered\" style=\"--bs-table-bg: transparent; --bs-table-accent-bg: transparent; --bs-table-striped-color: #697a8d; --bs-table-striped-bg: #f9fafb; --bs-table-active-color: #697a8d; --bs-table-active-bg: rgba(67, 89, 113, 0.1); --bs-table-hover-color: #697a8d; --bs-table-hover-bg: rgba(67, 89, 113, 0.06); width: 1301px;\"><tbody><tr><td colspan=\"2\" style=\"box-shadow: inset 0 0 0 9999px var(--bs-table-accent-bg); --bs-table-accent-bg: var(--bs-table-striped-bg);\">Serving size: 100 g</td></tr><tr><td style=\"box-shadow: inset 0 0 0 9999px var(--bs-table-accent-bg);\"></td><td style=\"box-shadow: inset 0 0 0 9999px var(--bs-table-accent-bg);\">Per Serving / 100g</td></tr><tr><td style=\"box-shadow: inset 0 0 0 9999px var(--bs-table-accent-bg); --bs-table-accent-bg: var(--bs-table-striped-bg);\">Energy</td><td style=\"box-shadow: inset 0 0 0 9999px var(--bs-table-accent-bg); --bs-table-accent-bg: var(--bs-table-striped-bg);\">652.4kcal*</td></tr><tr><td style=\"box-shadow: inset 0 0 0 9999px var(--bs-table-accent-bg);\">Protein</td><td style=\"box-shadow: inset 0 0 0 9999px var(--bs-table-accent-bg);\">17.2g</td></tr><tr><td style=\"box-shadow: inset 0 0 0 9999px var(--bs-table-accent-bg); --bs-table-accent-bg: var(--bs-table-striped-bg);\">Total Fat</td><td style=\"box-shadow: inset 0 0 0 9999px var(--bs-table-accent-bg); --bs-table-accent-bg: var(--bs-table-striped-bg);\">62.2g</td></tr><tr><td style=\"box-shadow: inset 0 0 0 9999px var(--bs-table-accent-bg);\">– Saturated Fat</td><td style=\"box-shadow: inset 0 0 0 9999px var(--bs-table-accent-bg);\">7.3g</td></tr><tr><td style=\"box-shadow: inset 0 0 0 9999px var(--bs-table-accent-bg); --bs-table-accent-bg: var(--bs-table-striped-bg);\">– Trans Fat</td><td style=\"box-s